Противовозду́шная оборо́на (сокр. ПВО) — комплекс мер по обеспечению защиты (обороны) от средств воздушного нападения противника. Различают ПВО: 
* войсковую; 
* объектовую; 
* корабельную. В российских условиях следует отличать Войска противовоздушной обороны Сухопутных войск (Войсковая ПВО) от войск (бригад) ПВО Военно-воздушных сил Российской Федерации (зенитные ракетные, радиотехнические, радиоэлектронной борьбы) и бригад противовоздушной обороны Войск воздушно-космической обороны, которые до 1998 года входили в самостоятельный вид вооружённых сил: Войска противовоздушной обороны Российской Федерации.

Obrona przeciwlotnicza – całokształt sił, środków i przedsięwzięć mających na celu niedopuszczenie lub ograniczenie do minimum oddziaływania lotnictwa nieprzyjaciela na wojska, ludność i obiekty na polu walki i na tyłach wojsk własnych. Wyodrębnia się obronę bierną i czynną. Cel obrony przeciwlotniczej osiąga się w wyniku realizacji dwóch zasadniczych funkcji: 
* niszczenia (obezwładniania) środków napadu powietrznego w powietrzu 
* informowania o zagrożeniu z powietrza. Obrona przeciwlotnicza jest częścią składową systemu obrony powietrznej. Do zasadniczych elementów obrony przeciwlotniczej należą: 
* prowadzenie rozpoznania celów powietrznych; 
* działania artylerii przeciwlotniczej i rakiet przeciwlotniczych, lotnictwa myśliwskiego oraz ; 
* prowadzenie zmasowanego ognia z broni strzeleckiej; 
* maskowanie i uodparnianie wojsk (obiektów) na skutki działania lotnictwa nieprzyjaciela. Głównym celem Wojsk OPL SP w latach 2007–2012 było osiąganie interoperacyjności z Zintegrowanym Systemem Obrony Powietrznej NATO – oraz z Wojskami Obrony Przeciwlotniczej Wojsk Lądowych i Marynarki Wojennej, w celu zapewnienia im możliwość wykonywania zadań w układzie narodowym, sojuszniczym i wielonarodowym (koalicyjnym), koncentrując swój wysiłek na osłonie: 
* wyznaczonych baz lotniczych, 
* wojsk operacyjnych w rejonach zgrupowań i przepraw, 
* najważniejszych obiektów przemysłowych i administracyjnych. W świetle tych zadań oraz obecnych i przewidywanych zagrożeń, oprócz zdolności do zwalczania samolotów, wojska OPL muszą posiadać zdolności do niszczenia rakiet balistycznych, pocisków samosterujących, bezpilotowych aparatów latających, obiektów powietrznych o małej skutecznej powierzchni odbicia. Zadania obrony przeciwlotniczej mogą być realizowane sposobami strefowo-obiektowej i bezpośredniej OPL. Strefowo-obiektowa OPL jest realizowana w osłonie wielu obiektów rozmieszczonych na znacznym obszarze. Organizuje się ją w warunkach dysponowania dużym i różnorodnym potencjałem bojowym. Bezpośrednia OPL jest realizowana w sytuacjach deficytu środków walki przeciwlotniczej. Jest ukierunkowana na osłonę konkretnych obiektów przed atakiem ŚNP z małych odległości i wysokości .
